import React from 'react';
import s from './Navbar.module.css'
import {NavLink} from "react-router-dom";

const Navbar = (props) => {
    return (
        <navbar className={s.navbar}>
            <NavLink className={s.logo} to={"/"}><span className={s.logoLetterE}>e</span>-board</NavLink>
            <input type="text" value={'search'}/>
            <NavLink className={`${s.btn} ${s.button}`} to={"/1"}>Поиск</NavLink>
            <NavLink className={`${s.btn} ${s.button}`} to={"/2"}>Разместить</NavLink>
            <NavLink className={`${s.btn} ${s.buttonActive}`} to={"/3"}>Войти</NavLink>
        </navbar>
    );
};

export default Navbar;
